import React from 'react'
import { Line } from 'react-chartjs-2';
import Chart from '../Components/Chart';
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
} from 'chart.js';

ChartJS.register(
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend
);

const ChartComponent = ({x, y}) => {
    return (
        <Line data={{
                labels: x,
                datasets: [
                    {
                        label: 'Training Accuracy',
                        data: y,
                        borderColor: '#3C51F9',
                        tension: 0,
                        backgroundColor: [
                            'rgb(255, 255, 255)'
                        ],
                    },
                ],
            }} 
            options={{
                scales: {
                    yAxes: [{
                        display: true,
                        ticks: {
                            min: 0,
                            max: 1,
                            stepSize: 0.1,
                            steps: 10,
                        }
                    }]
                },
                maintainAspectRatio: false,
                animation: false,
                responsive: false
            }}
            height={350} 
            width={350}
        />
    )
}

export default ChartComponent
